import logo from './logo.svg';
import './App.css';
import Particles from 'react-particles-js';

function Bio() {
  return (
    <div className="App">
      <header className="App-header">
        <p>
          Miguel Zurk Cruz
        </p>
        <Particles />
      </header>
    </div>
  );
}

export default Bio;
